import React from 'react';

const Chart = () => {
    return (
        <div className="w-full h-full flex flex-col items-center justify-center text-gray-500 p-4">
            {/* Simple CSS Bar Chart Visual */}
            <div className="flex items-end gap-3 h-32 mb-4 w-full justify-center">
                <div className="w-8 bg-blue-400/80 rounded-t-md h-[40%] animate-pulse"></div>
                <div className="w-8 bg-purple-400/80 rounded-t-md h-[60%] animate-pulse delay-75"></div>
                <div className="w-8 bg-pink-400/80 rounded-t-md h-[50%] animate-pulse delay-150"></div>
                <div className="w-8 bg-green-400/80 rounded-t-md h-[80%] animate-pulse delay-300"></div>
                <div className="w-8 bg-yellow-400/80 rounded-t-md h-[30%] animate-pulse delay-500"></div>
            </div>
            <p className="font-medium text-sm tracking-wide uppercase">Analytics Overview</p>
        </div>
    );
};

export default Chart;
